"""
Download real images and videos from Wikimedia Commons using MediaWiki API.
Stable, open, no giant metadata, no broken URLs.
"""

import random
import string
import requests
from pathlib import Path
from concurrent.futures import ThreadPoolExecutor

# ---------------- HARD-CODED PATHS ----------------

